import { Component, OnInit } from '@angular/core';
import { NgForm } from '@angular/forms';

@Component({
  selector: 'app-cadastro',
  templateUrl: './cadastro.page.html',
  styleUrls: ['./cadastro.page.scss'],
})
export class CadastroPage implements OnInit {
  dados= {
    nome: "",
    email: "",
    telefone: ""
  }

  constructor() { }

  ngOnInit() {
  }

  enviando(form: NgForm){
    console.log(form.value.nome)
  }

}
<ion-header [translucent]="true">
  <ion-toolbar color="danger">
    <ion-title>Cadastro</ion-title>
    <ion-menu-button color="dark" slot="start"></ion-menu-button>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <form #f="ngForm" (ngSubmit)="enviando(f)">
    <ion-item>
      <ion-label position="floating">Nome:</ion-label>
      <ion-input [(ngModel)]="dados.nome"  name="nome"></ion-input>
    </ion-item>
    <ion-item>
      <ion-label position="floating">Email:</ion-label>
      <ion-input [(ngModel)]="dados.email" name="email"></ion-input>
    </ion-item>
    <ion-item>
      <ion-label position="floating">Telefone:</ion-label>
      <ion-input [(ngModel)]="dados.telefone" name="telefone"></ion-input>
    </ion-item>
    <ion-button fill="outline" expand="block" type="submit">Cadastrar</ion-button>
  </form>
</ion-content>
